import React from 'react';

const Button = ({ children, onClick, className = '', variant = 'primary', ...props }) => {
    return (
        <button
            className={`btn btn-${variant} ${className}`}
            onClick={onClick}
            {...props}
        >
            {children}
        </button>
    );
};

// Named export kullanın
export { Button };
